import { singInWithGooglePopup, createUserDocumentFromAuth } from '../../../useful/fireBase/filebase.useful';

const SignIn = () => {
    const logGoogleUser = async () => {
        const response = await singInWithGooglePopup();
        createUserDocumentFromAuth(response);
    }
    
    return(
        <div>
            <h1> Sign in Page</h1>
            <button onClick={logGoogleUser}>
                Sign in with Google
            </button>
        </div>
    );
};

export default SignIn;
